import exercisesStore from "../stores/exercisesStore";

export default function ExerciseUpdate({exercise, number}) {
    const store = exercisesStore();

    return(
        <tr key={exercise._id} onClick={() => store.updateExerciseMode()}>
            <td>{number}</td>
            <td><input name="name" value={exercise.name} onChange={store.updateUpdateFormField}></input></td>
            <td><input name="weight" value={exercise.weight} onChange={store.updateUpdateFormField}></input></td>
            <td>{exercise.sets}</td>
            <td>{exercise.reps}</td>
            <td>{exercise.intensity}</td>
            <td>{exercise.notes}</td>
            <td className="delete" onClick={() => store.deleteExercise(exercise._id)}>X</td>
        </tr>
    );
}
